import Grid from "@mui/material/Grid";
const Pricing = () => {
  return (
    <>
      <Grid container spacing={1}>
        <Grid item xs={4} />
        <Grid item xs={2}>
          Free
        </Grid>
        <Grid item xs={3}>
          Individual
        </Grid>
        <Grid item xs={3}></Grid>
      </Grid>
    </>
  );
};
export default Pricing;
